        private string[,] previousShow = new string[51, 151];



        public void showTitle(int choice)
        {
            var currentTrack = new string[,] { };
            switch (choice)
            {
                case 0: currentTrack = NoSelection; break;
                case 1: currentTrack = StartSelection; break;
                case 2: currentTrack = ConvertSelection; break;
            }
            for (int i = 0; i < 50; i++)
            {
                for (int j = 0; j < 151; j++)
                {
                    if (previousShow[i, j] != currentTrack[i, j])
                    {
                        Console.SetCursorPosition(j, i);
                        Console.BackgroundColor = ConsoleColor.DarkBlue;
                        Console.Write(' ');
                        Console.SetCursorPosition(j, i);
                        // Console.Write(currentTrack[i, j]);
                        switch (currentTrack[i, j])
                        {
                            case "Track":
                                Console.BackgroundColor = ConsoleColor.DarkYellow;
                                break;
                            case "Grass":
                                Console.BackgroundColor = ConsoleColor.Green;
                                break;
                            case "Wall":
                                Console.BackgroundColor = ConsoleColor.Black;
                                break;
                            case "Unknown":
                                Console.BackgroundColor = ConsoleColor.DarkCyan;
                                break;
                        }
                        Console.Write(' ');
                        previousShow[i, j] = currentTrack[i, j];

                    }
                }
                Console.SetCursorPosition(0, 0);
            }
            Console.SetCursorPosition(0, 0);
        }

        public static void showCreds()
        {
            for (int i = 0; i < titleRefrence.Credits.GetLength(0) - 1; i++)
            {
                for (int j = 0; j < titleRefrence.Credits.GetLength(1); j++)
                {
                    Console.SetCursorPosition(j, i);
                    switch (titleRefrence.Credits[i, j])
                    {
                        case "Track":
                            Console.BackgroundColor = ConsoleColor.DarkCyan;
                            break;
                        case "Unknown":
                            Console.BackgroundColor = ConsoleColor.Cyan;
                            break;
                        case "Wall":
                            Console.BackgroundColor = ConsoleColor.DarkGreen;
                            break;
                        case "Grass":
                            Console.BackgroundColor = ConsoleColor.Green;
                            break;
                    }
                    Console.Write(' ');
                }
            }

        }

        public static void showGameTitle()
        {
            for (int i = 0; i < titleRefrence.Otitle.GetLength(0) - 1; i++)
            {
                for (int j = 0; j < titleRefrence.Otitle.GetLength(1); j++)
                {
                    Console.SetCursorPosition(j, i);
                    switch (titleRefrence.Otitle[i, j])
                    {
                        case "Track":
                            Console.BackgroundColor = ConsoleColor.DarkCyan;
                            break;
                        case "Unknown":
                            Console.BackgroundColor = ConsoleColor.Cyan;
                            break;
                        case "Wall":
                            Console.BackgroundColor = ConsoleColor.Green;
                            break;
                        case "Grass":
                            Console.BackgroundColor = ConsoleColor.Green;
                            break;
                    }
                    Console.Write(' ');
                }
                Console.SetCursorPosition(0, 0);
            }
            Console.SetCursorPosition(0, 0);


        }

